                    data.minPoints = parseInt(symbols[i].childNodes[4].text, 10); //MINPOINTS
                    data.maxPoints = parseInt(symbols[i].childNodes[3].text, 10); //MAXPOINTS
                    data.drawCategory = parseInt(symbols[i].childNodes[2].text, 10); //DRAWCATEGORY
